d DENUNCIA ASEGURADO: CC: El asegurado transitaba por la calle de referencia cuando al llegar a la interseccion mencionada, ve que habia un tercero. Le hace luces y senas para avisarle que iba a pasar, y el tercero le cede el paso. Es cuando comienza a cruzar que una motocicleta a alta velocidad cruza sin ver si habia terceros, provocando que el asegurado le impacte. No intervino policia ni ambulancia, el tercero se retiro por sus propios medios, para luego ir a hacerse estudios. Posteriormente el asegurado se contacto con el tercero, para consultar su estado, el cual le indico que le habian sacado una placa que no demostraba ningun dano, le indicaron tomar medicamentos y reposo.

AMPLIACION ASEGURADO: \lang10240 El vehiculo Chery Q.Q asegurado circulaba por calle Mendoza con sentido Norte a Sur y al efectuar el cruce de calle 9 de Julio embiste con el sector frontal  a la motocicleta Yamaha M125 conducida por el tercero que se desplazaba por esta ultima arteria con sentido Este a Oeste. Tras el choque la motocicleta y su tripulante caen al piso de la calzada

