d DENUNCIA ASEGURADO: FF-Siendo alrededor de las 12.42 hs., la unidad blindada nro. 1536, conducida por el chofer Juan Bautista Rojas, en servicio, circulaba por la avda. Corrientes y al llegar a la interseccion de esa con la avda. Scalabrini Ortiz de la ciudad Autonoma de Buenos Aires, por motivos que se tratan de establecer embistio a un peaton del sexo femenino, de 65 anos o mas de edad aproximadamente, produciendole lesiones graves en uno de sus miembros inferiores (fractura expuesta) y otras lesiones de consideracion en miembros superiores y torso. Por intermedio de la central de monitoreo remoto, se solicito de inmediato la presencia policial y de una unidad sanitaria en el lugar, al
mismo tiempo que se convoco la presencia de los tres inspectores de gestion de riesgos mas proximos al lugar.Por intermedio del departamento de Legales se ha comunicado que en la fecha 11/05/2017 se produjo el fallecimiento de la victima del accidente, -ER

 De:0  Guillermo Novik  [mailto:Guillermo.Novik@prosegur.com] <mailto:[mailto:Guillermo.Novik@prosegur.com]>none   Enviado el:0  jueves, 11 de mayo de 2017 11:31 a.m. Para:0  Irurzun, Victor Asunto:0  stro GPR720   Hola Victor:   Por favor confirmar si ayer te han informado este siniestro de una unidad blindada de TCJ S.A. en CABA.   Siendo alrededor de las 12.42 hs., la unidad blindada nro. 1536, conducida por el chofer Juan Bautista Rojas, en servicio, circulaba por la avda. Corrientes y al llegar a la interseccion de esa  con la avda. Scalabrini Ortiz de la ciudad Autonoma de Buenos Aires, por motivos que se tratan de establecer embistio a un peaton del sexo femenino, de 65 anos o mas de edad aproximadamente, produciendole lesiones graves en uno de sus miembros inferiores (fractura expuesta) y otras lesiones de consideracion en miembros superiores y torso.  Por intermedio de la central de monitoreo remoto,  se solicito de inmediato la presencia policial y de una  unidad sanitaria en el lugar, al mismo tiempo que se convoco la presencia de los tres inspectores de gestion de riesgos  mas proximos al lugar. Arribados los inspectores al lugar constataron  que:  \'fc    El chofer quedo en calidad demorado en dependencias de la Comisarias nro. 27 de la Policia de la Ciudad hasta tanto se resuelva su situacion procesal (aun permanece en esa dependencia), llevandose a cabo las pertinentes pericias sobre su estado psicofisico. \'fc    La imputacion legal es Lesiones graves por culpa o imprudencia  \'fc    Que los valores transportados fueron trasbordados a otra UUBB sin registrarse complicaciones en ese sentido. \'fc    La unidad blindada involucrada que secuestrada a los efectos periciales en dependencia policial a la espera de la correspondiente evaluacion de su estado general (pericia mecanica). \'fc    En el caso interviene el Juzgado Correccional N\'b0 62 a cargo del Giandut por ante la secretaria del Dr. Ricco. \'fc    Que el empleado de Prosegur es asistido por profesionales del Departamento de Legales y los asesores externos correspondientes. \'fc    Que el hecho en si ha tenido impacto en la prensa, hasta el momento con un perfil no muy alto, no se han visualizado tendencias en ese sentido en contra de la empresa, a la espera de como se desarrolle el hecho en la fecha en los distintos medios de comunicacion. \'fc    La victima fue trasladada por una ambulancia del servicio de emergencia de la ciudad a dependencias del Hospital Duran, a efectos su atencion inmediata adelantando que su estado general es reservado respecto de su pronostico.  Luego se informa:   Por intermedio del departamento de Legales se ha comunicado que en la fecha se produjo el fallecimiento de la victima del accidente, con lo cual se transformado en Homicidio por Culpa o Imprudencia, y bajo ese cargo en la fecha presta declaracion el chofer que se encuentra directamente imputado acompanado de los asesores legales de la empresa y externo.  Los resultados que se obtengan se comunicaran con el informe definitivo.  Saludos.

