d Version Asegurado: 0 Nos dirigiamos transitando por la Au. Panamericana, sentido a CABA, en el segundo carril, junto con mi yerno Matias Taipio, quien conducia y yo me encontraba como acompanante. Cuando aproximadamente a la altura de Pelliza, un auto de modelo, marca y patente desconocido pasa a mucha velocidad por la derecha a unos metros y nos encierra (sin roce). Ante la maniobra imprudente del otro conductor, Matias Taipio, atina a tocar el freno, lo que ocasiona la perdida de control del auto (cabe destacar que la calzada se encontraba mojada). Mi auto Toyota fuera de control colisiona de frente contra el guardarrail derecho y luego con la parte trasera izquierda, lo que produce que el auto sea despedido nuevamente al segundo carril, luego de dar varios trompos. Al encontrarnos sin lesiones tanto el conductor, como yo el acompanante, salimos del auto y nos colocamos sobre el guardarrail derecho a esperar la asistencia de la autopista.

 Ampliacion Asegurado:0   el vehiculo NN se le cruza adelante y cuando frena el conductor asegurado, pierde el control y se desliza hacia la derecha, impacta sobre el guardarail derecho con su parte frontal izquierda (ya estaba haciendo el trompo). Mientras que gira vuelve a pegar contra el mismo guarrail con su partre trasera izquierdo, ello hace que rebote y empiece a girar en sentido contrario. El giro fue de aprox. 180\'b0. Ello hace que quede frenado dentro de la Autopista con su trompa en el sentido de circulacion (CABA). Se bajan del auto y se van a la banquina del lado derecho, el vehiculo quedo en el carril 2/3. El tercero no fue parte del accidente, sino que fue un auto que circulaba por la autopista que se llevo puesto parte de los restos del auto asegurado. De los restos plasticos. Informo el telefono del tercero. Desde que se baja del auto hasta que llego la grua, habran pasado 10/15 minutos.-

